import React from 'react';

function About() {
  return (
    <div className="page-content">
      <h1>About Me</h1>
      <p>
        I am a dedicated and detail-oriented web developer and programmer with a strong foundation in full-stack development using the MERN stack.
      </p>
      <p>
        I’m currently pursuing my degree and actively working on real-world projects that combine frontend and backend technologies.
        My key strengths include creativity in UI/UX design, structured code development, and a passion for learning and innovation.
      </p>
      <p>
        I’m also exploring artificial intelligence and machine learning applications in healthcare and education domains.
      </p>
    </div>
  );
}

export default About;
